удущим пациентам удачи, веры и везения! Доверяйте своему доктору и тогда у вас обязательно под боком будет сопеть маленький комочек счастья!!!	";s:4:"TYPE";s:4:"HTML";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"23447:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"23447:26";s:24:"PROPERTY_LAST_NAME_VALUE";N;s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"23447:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"23447:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";N;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"23447:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PROPERTY_FILE_PROPERTY_VALUE_ID";a:0:{}s:10:"specialist";b:0;s:4:"file";a:0:{}}i:23942;a:24:{s:2:"ID";s:5:"23942";s:11:"ACTIVE_FROM";s:13:"2 мая 2019";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:10:"Елена";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"23942:21";s:20:"PROPERTY_EMAIL_VALUE";s:17:"latimera@inbox.ru";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"23942:22";s:25:"PROPERTY_SPECIALIST_VALUE";s:0:"";s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"23942:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:1230:"Выражаю огромную благодарность и низкий поклон всей команде врачей и генетиков в центре за двойное счастье стать мамой дочки и сына. 10 лет не могли забеременеть по мужскому фактору, вторая попытка по квоте(первая в другом центре была) и чудо случилось!Я попала на майские праздники в 2018 году, поэтому со всеми познакомилась в процессе, вела протокол Васильева Ольга Евгеньевна, яйцеклетки брал Кирсанов, а подсаживала Близнюкова. Генетики в этом центре профессионалы своего дела, таких малышей нам отобрали.  Спасибо вам, крепкого вам всем здоровья, процветания и успехов в вашем непростом деле, но очень нужном !!!На 35 неделе родились малыши, уже 4 месяца радуют нас с мужем!!!";s:4:"TYPE";s:4:"HTML";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"23942:24";s:19:"PROPERTY_FILE_VALUE";a:1:{i:0;s:4:"5670";}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VA